function viral_news_get_google_font_variants() {

    $font_list = array_merge(viral_news_default_font_array(), viral_news_standard_font_array(), viral_news_google_font_array());

    $font_family = isset($_REQUEST['font_family']) ? sanitize_text_field(wp_unslash($_REQUEST['font_family'])) : '';
    $font_array = viral_news_search_key($font_list, 'family', $font_family);

    $variants_array = $font_array['0']['variants'];

    if ($variants_array) {
        foreach ($variants_array as $key => $variants) {
            $selected = $key == '400' ? 'selected="selected"' : '';
            ?>
            <option <?php echo esc_attr($selected); ?> value="<?php echo esc_attr($key); ?>"><?php echo esc_html($variants); ?></option>
            <?php
        }
    }
    die();
}

add_action("wp_ajax_viral_news_get_google_font_variants", "viral_news_get_google_font_variants");

function viral_news_search_key($array, $key, $value) {
    $results = array();
    if (is_array($array)) {
        if (isset($array[$key]) && $array[$key] == $value) {
            $results[] = $array;
        }
        foreach ($array as $subarray) {
            $results = array_merge($results, viral_news_search_key($subarray, $key, $value));
        }
    }
    return $results;
}

function viral_news_default_font_array() {
    return array(
        'default' => array(
            'family' => 'Default',
            'variants' => array(
                '100' => esc_html__('Thin', 'viral-news'),
                '300' => esc_html__('Light', 'viral-news'),
                '400' => esc_html__('Normal', 'viral-news'),
                '400italic' => esc_html__('Normal Italic', 'viral-news'),
                '500' => esc_html__('Medium', 'viral-news'),
                '600' => esc_html__('Semi Bold', 'viral-news'),
                '700' => esc_html__('Bold', 'viral-news'),
                '700italic' => esc_html__('Bold Italic', 'viral-news')
            ),
            'subsets' => array(
                'latin' => 'Latin'
            )
        )
    );
}

